records.addlTxt:
The State files and Amended Information which charges one count misdemeanor battery, contrary to Section 940.19(1) and one count disorderly conduct, contrary to Section 947.01(1) of the Wisconsin Statutes.  
GUILTY pleas entered to both counts in the Amended Information.  Convicted.
Sentence Withheld.  Defendant is placed on probation to DOC for two (2) years.
Conditions of probation:
1) Pay restitution of $2,817.78 to Kira Golden at 2512 S. 21st Street, Manitowoc, WI;
2) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
3) Spend two (2) months in the county jail, under the Huber Law, on count 1 only, commencing on 04-07-16 at 5:00 p.m.  Defendant will serve the first 30 days and shall be released on 05-07-16 and will report back on 05-09-16 to serve the balance of the condition time;
4) Spend an additional two (2) months in the county jail, under the Huber Law, on count 1 only, stayed and to be imposed at the agents discretion and upon order of the court;
5) Provide DNA sample;
6) Pay court costs;
7) pay supervision fees in an amount to be determined by DOC;
8) No contact with Kira Golden;
9) Obtain GED, HSED or high school diploma within the first year of probation.
Minutes.
